
    <style>
       main {
            margin: 0;
            height: 100vh;
            display: flex;
            position: absolute;
            top: 0;
            width: 100vw;
            justify-content: center;
            align-items: center;
            background-color: rgb(0, 0, 0);
            animation:moveUp 3s forwards;
        }

    
        svg {
            margin-bottom: 0.5rem;
            width: 20rem;
            height: auto;
            stroke: rgb(255, 255, 255);
            fill: none;
            stroke-width: 5;
            stroke-linecap: round;
            stroke-linejoin: round;
            stroke-dasharray: 500;
            stroke-dashoffset: 500;
            animation: draw 3s forwards, vanish 2s ease-out 1.5s forwards;
        }
        @media (max-width: 600px) {
            svg {
                width: 10rem;
            }
        }
        @keyframes draw {
            0% {
                stroke-dashoffset: 500;
            }
            70% {
                
                stroke: #ffaa00;
                stroke-dashoffset: 0;
            }
            100% {
                
                stroke-dashoffset: 0;
            }
        }
        @keyframes vanish {
            0% {
                opacity: 1;
            }
            100% {
                opacity: 0;
            }
        }
        #loading {
        height: 100vh;
        overflow: hidden;
        position: relative;
        background: transparent;
         }
    </style>
    
